import React, { Component } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';import { withRouter } from 'react-router-dom';
class Edit extends Component {
  constructor(props) {
    super(props);
    this.state = {
      product: {
        name: '',
        price: '',
        image: '',
        color: '',
        name_category: '',
        material: '',
        expiry_date: '',
        origin: '',
        description: '',
      },
    };
  }

  handleInputChange = (event) => {
    const { name, value } = event.target;
    this.setState((prevState) => ({
      product: {
        ...prevState.product,
        [name]: value,
      },
    }));
  };

  handleSubmit = async (event) => {
    event.preventDefault();
    const { id } = this.props.match.params;
    const { product } = this.state;

    try {
      await axios.put(`http://localhost:3000/products/${id}`, product);
      this.setState({
        product: {
          name: '',
          price: '',
          image: '',
          color: '',
          name_category: '',
          material: '',
          expiry_date: '',
          origin: '',
          description: '',
        },
      });

      alert('Product edited successfully!');

      setTimeout(() => {
        window.location = 'http://localhost:3001';
      }, 100);
    } catch (error) {
      console.log('Error editing product:', error);
    }
  };

  componentDidMount() {
    const { id } = this.props.match.params;
    fetch(`http://localhost:3000/products/${id}`)
      .then(response => response.json())
      .then(data => this.setState({ product: data }));
  }
  

  render() {
    const { product } = this.state;

    return (
      <div className="container">
        <h1>Edit Product</h1>
        <form onSubmit={this.handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">
              Name:
              <input
                className="form-control"
                id="name"
                type="text"
                name="name"
                value={product.name}
                onChange={this.handleInputChange}
              />
            </label>
          </div>
          <div className="form-group">
            <label htmlFor="price">
              Price:
              <input
                className="form-control"
                id="price"
                type="number"
                name="price"
                value={product.price}
                onChange={this.handleInputChange}
              />
            </label>
          </div>
          <div className="form-group">
            <label htmlFor="image">
              Image:
              <input
                className="form-control"
                id="image"
                type="text"
                name="image"
                value={product.image}
                onChange={this.handleInputChange}
              />
            </label>
          </div>
          <div className="form-group">
            <label htmlFor="color">
              Color:
              <input
                className="form-control"
                id="color"
                type="text"
                name="color"
                value={product.color}
                onChange={this.handleInputChange}
              />
            </label>
          </div>
          <div className="form-group">
            <label htmlFor="name_category">
              Category:
              <input
                className="form-control"
                id="name_category"
                type="text"
                name="name_category"
                value={product.name_category}
                onChange={this.handleInputChange}
              />
            </label>
          </div>
          <div className="form-group">
            <label htmlFor="material">
            <input
              className="form-control"
              id="material"
              type="text"
              name="material"
              value={product.material}
              onChange={this.handleInputChange}
            />
          </label>
        </div>
        <div className="form-group">
          <label htmlFor="expiry_date">
            Expiry Date:
            <input
              className="form-control"
              id="expiry_date"
              type="date"
              name="expiry_date"
              value={product.expiry_date}
              onChange={this.handleInputChange}
            />
          </label>
        </div>
        <div className="form-group">
          <label htmlFor="origin">
            Origin:
            <input
              className="form-control"
              id="origin"
              type="text"
              name="origin"
              value={product.origin}
              onChange={this.handleInputChange}
            />
          </label>
        </div>
        <div className="form-group">
          <label htmlFor="description">
            Description:
            <input
              className="form-control"
              id="description"
              type="text"
              name="description"
              value={product.description}
              onChange={this.handleInputChange}
            />
          </label>
        </div>
        <button type="submit" className="btn btn-primary">
          Save
        </button>
      </form>
    </div>
  );
  }
}

export default Edit;
